{"description": "MRNY typically enrolls students in Citizenship classes 4 times a year and 3 times a year for English and Food Handlers:
• Late December/early January for all classes starting in January;
• Late March for all classes starting in April;
• Late June/early July for Citizenship classes starting in July;
• Mid-July/August for English and Food Handler classes starting in September and Citizenship classes starting in October.", "eventRelatedInfo": {"event": "COVID19", "information": "• Please join the waitlist at <a href="https://maketheroadny.formtitan.com/AdultEd#/">maketheroadny.formtitan.com/AdultEd</a>."}}
